import React from "react";
import Navbar from "./Navbar.jsx";
import Opener from "./Opener.jsx";
import {aboutMe,Education,Certifications,workExperience} from "./Remaining.jsx";
function App() {
  return (
    <div>
      <Navbar />
      <Opener />
      <div class = "remainingSection">
        <aboutMe/>
        <Education/>
        <Certifications/>
        <workExperience/>
      </div>
      
    </div>
  );
}

export default App;
